import React, { Component } from 'react';
import './App.css';

import Contentbox from '../containers/Contentbox';
import Navbar from '../frontend/src/components/Navbar';

class App extends Component {
  render() {
    return (
      <div id="background">
        <Navbar />
        <Contentbox />
      </div>
    );
  }
}

export default App;
